// Buttons.js
import React from 'react';

const Buttons = ({ login, logout }) => {
  return (
    <div>
      {/* Your button implementation here */}
      <button onClick={login}>Login</button>
      <button onClick={logout}>Logout</button>
    </div>
  );
};

export default Buttons;
